import React from 'react';

import {
	Typography,
	CardContent,
	Card,
	CardActions,
	makeStyles,
	Button,
} from '@material-ui/core';

const useStyles = makeStyles({
	root: {
		minWidth: 275,
	},
	bullet: {
		display: 'inline-block',
		margin: '0 2px',
		transform: 'scale(0.8)',
	},
	title: {
		fontSize: 14,
	},
	pos: {
		marginBottom: 12,
	},
});

export default function FriendCard({ friend }) {
	const classes = useStyles();
	return (
		<Card className={classes.root} variant='outlined'>
			<CardContent>
				<Typography
					className={classes.title}
					color='textSecondary'
					gutterBottom
				>
					Name: {friend.name}
				</Typography>
				<Typography className={classes.pos} color='textSecondary'>
					Age: {friend.age}
				</Typography>
				<Typography variant='body2' component='p'>
					Email: {friend.email}
				</Typography>
			</CardContent>
			<CardActions>
				<Button size='small'>Delete Friend</Button>
			</CardActions>
		</Card>
	);
}
